import React from "react";
import "./style.css";

const TemplateError = ({ data }) => {
  return (
    <>
      <div id="notfound">
        <div class="notfound">
          <div class="notfound-404"></div>
          <h1>404</h1>
          <h2>Oops! Page Not Be Found </h2>
          <h3 className="text-danger">{data}</h3>
        </div>
      </div>
    </>
  );
};

export default TemplateError;
